import React, { useEffect } from "react";
import styles from "../styles/StudentList.module.css";
import { useSelector, useDispatch } from "react-redux";
import { getUserList } from "../features/userSlice";

function StudentList() {
  const dispatch = useDispatch();
  const [student, setStudent] = React.useState("");
  const token = useSelector((state) => state.auth.token);
  const users = useSelector((state) => state.user.users);

  useEffect(() => {
    dispatch(getUserList(token));
  }, []);

  console.log(student);
  console.log(users);
  return (
    <div className={styles.studentList}>
      <input onChange={(e) => setStudent(e.target.value)} />
      <div>
        {users
          .filter((user) => {
            if (student === "") {
              return null;
            } else if (
              user.first_name.toLowerCase().includes(student.toLowerCase()) ||
              user.last_name.toLowerCase().includes(student.toLowerCase())
            ) {
              return user;
            } else {
              return null;
            }
          })
          .map((u) => (
            <div>
              {u.first_name} {u.last_name}
              <br />
            </div>
          ))}
      </div>
    </div>
  );
}

export default StudentList;
